import React from "react";
import "./About.css";

function About() {
    return (
        <div className="about">
            <h1>About Us</h1>
            <div className="about-container">
                <div className="section-one">
                    <img className="catalina" src="images/catalina.png" alt="" />
                    <p>Catalina Cassity-Partner</p>
                </div>
            </div>
        </div>
    )
}

export default About;
